import React from 'react';
import {useSpring, animated} from 'react-spring';

const SideBar = ({ open }) => {
  const props = useSpring({ number: 1, from: { number: 0 } })
 
  return (

    <animated.div style={props}
      className={
        open
          ? " fixed right-0 lg:w-2/6  mr-1 w-3/4 bg-gray-100 h-full mt-2 "
          : "hidden  "
      }
      
    ><p>kjkjkjkj</p><animated.span>{props.number}</animated.span></animated.div>
  );
};


export default SideBar;
